import React from 'react'
import './Playlists.css'
import Banner from '../images/banner.png'

const PlaylisInfos = [
  {id: 1, author: 'Mitti', title: 'Sou Triste e DECADENTE', songs: 7}
];

const Playlists = () => {
  return (
    <div>
      <div>
        <div className='container'>
          {/* Image cape of playlist */}
          <div className='backgrouGradient'></div>
          <img src={Banner}  className='banner'/>

          {/* Informations of Playlist */}
          {PlaylisInfos.map((music) => (
            <div className='playlisInfos'>
              <h1 key={music.id}>{music.title}</h1>
              <p key={music.id} className='author'>Por: {music.author}</p>
              <p className='numberSongs'></p>
            </div>
          ))};
        </div>
      </div>
    </div>
  )
}



export default Playlists;
